css:
.ask-view {
  overflow-y: auto;
  cursor: default;
  padding: 0 5px 0 5px;
}
.ask-view .settings-name {
  font-size: 1.5em;
  font-weight: bold;
}
.ask-view .buttons {
  padding: 5px 5px 5px 5px;
  display: flex;
  justify-content: space-between;
  border-width: 1px 0 0 0;
  border-color: #383838;
  border-style: solid;
}
.ask-view .error {
  color: #7f2c2c;
}
.ask-view .hidden {
  display: none;
}
